import ListGroup from './components/ListGroup';

function App() {
  let myHeading = "Cities"
  let myList = ['New York', 'Paris', 'London', 'Tokyo', 'Jaipur', 'Sydney'];

  return <div><ListGroup heading={myHeading} items={myList} /></div>;
}

export default App;
